import React from "react";
import { Card, CardMedia, CardContent, Typography } from "@material-ui/core";
import "./style.css";

const Team = ({ name, description, avatar }) => (
    <Card className="member-card">
    <CardMedia
      component="img"
      alt={name}
      height="140"
      image={avatar}
      title={name}
      className="member-avatar"
    />
    <CardContent>
      <Typography gutterBottom variant="h5" component="h2" className="member-name">
        {name}
      </Typography>
      <Typography variant="body2" color="textSecondary" component="p" className="member-description">
        {description}
      </Typography>
    </CardContent>
  </Card>
);

export default Team;
